import {
   GET_PROFILE,
   GET_PROFILES,
   GET_ERRORS,
   PROFILE_LOADING,
   PROFILE_NOT_FOUND,
   CLEAR_CURRENT_PROFILE
} from '../actions/types';


const initialState = {
   profle: null,
   profiles: null,
   loading: false
};

export default function (state = initialState, action) {
   switch (action.type){
      case GET_PROFILE:
         return {
            ...state,
            profile: action.payload
         };
      default:
         return state;
   }
   
}
